import React from "react";

const ToggleColumns = (Props) => {
  let onCheckboxClick = ({ target }) => {
    Props.onCheckboxClick(target.name, target.value);
  };
  return (
    <div className="toggle-columns">
      {/* Bind handlers and props */}
      {Object.keys(Props.columns).map((column, index) => {
        return (
          <div key={index}>
            <label>{column}</label>
            <input type="checkbox" onChange={(e) => Props.onCheckboxClick(e)} />
          </div>
        );
      })}
    </div>
  );
};

export default ToggleColumns;
